create database if not exists `e_commerce`;

USE `e_commerce`;

/*Table structure for table `movierecomend` */

DROP TABLE IF EXISTS `movierecomend`;

CREATE TABLE `movierecomend` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `movietype` varchar(45) NOT NULL,
  `hero` varchar(45) NOT NULL,
  `herpoine` varchar(45) NOT NULL,
  `banner` varchar(45) NOT NULL,
  `interest` varchar(45) NOT NULL,
  `content` longtext NOT NULL,
  `rate` varchar(45) NOT NULL,
  `moviename` varchar(45) NOT NULL,
  `photo` longblob NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `movierecomend` */

/*Table structure for table `pro_history` */

DROP TABLE IF EXISTS `pro_history`;

CREATE TABLE `pro_history` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `proid` varchar(45) NOT NULL,
  `proname` varchar(45) NOT NULL,
